import React from "react";

const Modal = ({ selected }) => {
  return (
    <>
      {selected === "compare" && (
        <div className="compare">
          <div className="comparison-list">
            <div className="container-fluid">
              <div className="row">
                <div className="col-md-3">Plan 1</div>
                <div className="col-md-3">Plan 1</div>
                <div className="col-md-3">Plan 1</div>
                <div className="col-md-3">Plan 1</div>
              </div>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Modal;
